[include ./KAMP/KAMP_Settings.cfg]

[include beacon_probe.cfg]

[include print_start_end.cfg]

[include macro_thermal_expansion_compensation.cfg]

[include klipperscreen_shutdown.cfg]

[include klipper_expander.cfg]

[delayed_gcode IDLE_LOOP] 
initial_duration: 120 
gcode: 
    CHECK_IDLE 
    UPDATE_DELAYED_GCODE ID=IDLE_LOOP DURATION=120

[gcode_macro SHUTDOWN]
gcode:
  KLIPPERSCREEN_SHUTDOWN_MACRO
  G4 P5000
  {action_call_remote_method("shutdown_machine")}

#####################################################################
# Kinematics
#####################################################################
[printer]
kinematics: corexy
max_velocity: 600
max_accel: 20000
max_z_velocity: 20
max_z_accel: 500
square_corner_velocity: 8

#####################################################################
# Motherboard and periphery
#####################################################################
[temperature_sensor Mainboard_RK3328]
sensor_type: temperature_host
min_temp: 10
max_temp: 100

[mcu]
serial: /dev/ttyS0
restart_method: command

[temperature_sensor Mainboard_STM32F402]
sensor_type: temperature_mcu
sensor_mcu: mcu

[mcu Toolhead]
serial: /dev/serial/by-id/usb-Klipper_rp2040_959C8B96355A4E58-if00

[temperature_sensor Toolhead_STM32F103XE]
sensor_type: temperature_mcu
sensor_mcu: Toolhead
min_temp: 0
max_temp: 100

#####################################################################
# Features
#####################################################################
# For saving GCODE files
[virtual_sdcard]
path: ~/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

# For enabling pause/resume
[pause_resume]

# Activating exclude objects feature
[display_status]
[exclude_object]

# Expanding idle timeout
[idle_timeout]
timeout: 1800

# Activating GCODE arc feature
[gcode_arcs]
resolution: 1.0

[save_variables]
filename: ~/printer_data/config/variables.txt

#####################################################################
# Macros
#####################################################################
[include macros.cfg]

#####################################################################
# Input shaping
#####################################################################
#[resonance_tester]
#accel_chip:adxl345
#probe_points: 140, 140, 10
#accel_per_hz: 75
#sweeping_period: 0
#max_smoothing: 0.5

#[adxl345]
#cs_pin: Toolhead:gpio13
#spi_software_sclk_pin: Toolhead:gpio14
#spi_software_mosi_pin: Toolhead:gpio15
#spi_software_miso_pin: Toolhead:gpio12
#axes_map: -x, z, -y

[input_shaper]
#shaper_type_x: mzv
#shaper_freq_x: 57.6
#shaper_type_y: mzv
#shaper_freq_y: 46.6

[mcu NIS]
serial: /dev/serial/by-id/usb-Klipper_stm32f042x6_0C000D000843565036343620-if00
is_non_critical: true

#[adxl345]
#cs_pin: NIS:PA4
#spi_software_sclk_pin: NIS:PA5
#spi_software_mosi_pin: NIS:PA7
#spi_software_miso_pin: NIS:PA6

#[resonance_tester]
#accel_chip: adxl345
#probe_points: 140, 140, 10

[resonance_tester]
accel_chip: beacon
probe_points: 138, 112, 20

[shaketune]
result_folder: ~/printer_data/config/ShakeTune_results
number_of_results_to_keep: 10
keep_raw_data: false
show_macros_in_webui: true
timeout: 600
measurements_chunk_size: 2
max_freq: 200
dpi: 300

#####################################################################
# Hotend
#####################################################################
[extruder]
step_pin: Toolhead:gpio5
dir_pin: Toolhead:gpio4
enable_pin: !Toolhead:gpio10
rotation_distance: 53.5
gear_ratio: 1628:170				
microsteps: 16
full_steps_per_rotation: 200
nozzle_diameter: 0.400
filament_diameter: 1.75
min_temp: 0
max_temp: 360
min_extrude_temp: 170
smooth_time: 0.000001
step_pulse_duration: 0.000002

heater_pin: Toolhead:gpio0
sensor_type:MAX6675
sensor_pin: Toolhead:gpio17
max_power: 1.0

spi_speed: 100000
spi_software_sclk_pin: Toolhead:gpio18
spi_software_mosi_pin: Toolhead:gpio19
spi_software_miso_pin: Toolhead:gpio16

pressure_advance: 0.032
pressure_advance_smooth_time: 0.03
max_extrude_cross_section: 5
instantaneous_corner_velocity: 10.000
max_extrude_only_distance: 500.0
max_extrude_only_velocity: 5000
max_extrude_only_accel: 2000

[verify_heater extruder]
max_error: 120
check_gain_time: 20
hysteresis: 5
heating_gain: 1

#####################################################################
# Heated bed
#####################################################################
[heater_bed]
heater_pin: PC8
sensor_type: NTC 100K MGB18-104F39050L32
sensor_pin: PA0
max_power: 1.0
min_temp: 0
max_temp: 125
pwm_cycle_time: 0.016

[verify_heater heater_bed]
max_error: 200
check_gain_time: 360
hysteresis: 5
heating_gain: 1

#####################################################################
# Bed mesh
#####################################################################
[bed_mesh]
speed: 300               
horizontal_move_z: 5   
mesh_min: 20, 14
mesh_max: 257, 238       
zero_reference_position: 138, 136    
probe_count: 30, 30    
algorithm: bicubic
bicubic_tension: 0.2
mesh_pps: 4, 4

#####################################################################
# Probe
#####################################################################
#[safe_z_home]
#home_xy_position: 138, 112
#z_hop: 3

#[probe]
#pin: ^!Toolhead:gpio21
#x_offset: 27.8
#y_offset: 6.75
#speed: 5
#samples: 2
#samples_result: average
#sample_retract_dist: 0.7
#samples_tolerance: 0.08
#samples_tolerance_retries: 3

#####################################################################
# Heated chamber
#####################################################################
[heater_generic chamber]
heater_pin: PB10
max_power:1.0
sensor_type:NTC 100K MGB18-104F39050L32
sensor_pin: PA1
control: watermark
max_delta: 0.5
min_temp:-100
max_temp:70

[verify_heater chamber]
max_error: 300
check_gain_time:480
hysteresis: 5
heating_gain: 1

########################################
# Filament runout sensor
########################################
# [filament_switch_sensor filament]
# switch_pin: !PC1
# pause_on_runout: True
# runout_gcode: M118 Filament run out!
# event_delay: 3.0
# pause_delay: 0.5

[filament_switch_sensor switch_sensor]
switch_pin: PC3
pause_on_runout: False
runout_gcode:
  PAUSE
  M117 Filament switch runout
insert_gcode:
  M117 Filament switch inserted

[filament_motion_sensor encoder_sensor]
switch_pin: !PC1
detection_length: 2.88
extruder: extruder
pause_on_runout: False
runout_gcode:
  PAUSE
  M117 Filament encoder runout
insert_gcode:
  M117 Filament encoder inserted

#####################################################################
# Fans
#####################################################################
## Part cooling fan 
[fan_generic partfan]
pin: Toolhead:gpio2
max_power: 1.0
cycle_time: 0.0100
hardware_pwm: false
kick_start_time: 0.200
min_power: 0.08
shutdown_speed: 0

## Big side radial turbo fan
[fan_generic sidefan]
pin: PA8
max_power: 1.0
cycle_time: 0.0100
hardware_pwm: false
kick_start_time: 0.250
min_power: 0.3
shutdown_speed: 0

## Activated charcoal blowing fan
[fan_generic filterfan]
pin: PC9
max_power: 1.0
cycle_time: 0.0100
hardware_pwm: false
kick_start_time: 0.200
min_power: 0.3
shutdown_speed: 0

## Cold end and toolhead housing fans
[heater_fan hotend_fan]
pin: Toolhead:gpio1
max_power: 1.0
shutdown_speed:1.0
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0
fan_speed: 1.0
min_power: 0

#!# Delete the next section if your stock backup config doesnt have it
# Toolhead cooling fan
[heater_fan hotend_fan2]
pin: Toolhead:gpio20
max_power: 1.0
shutdown_speed:1.0
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0
fan_speed: 1.0
min_power: 0

#!# Delete the next section if your stock backup config doesnt have it
## Controllable Mainboard cooling fan
[temperature_fan Mainboard_fan]
sensor_type: temperature_host 
pin: PC4        
max_power: 1.0  
cycle_time: 0.01
sensor_type: temperature_combined
sensor_list: temperature_sensor Mainboard_RK3328, temperature_sensor Mainboard_STM32F402
combination_method: max                                           # use the maximum reading of the sensors
maximum_deviation: 999.9                                          # we don't care about the difference in temperature
shutdown_speed: 0.0
kick_start_time: 0.4
min_power: 0.19
min_temp: 0
max_temp: 85.0  
target_temp: 42.0
min_speed: 0
max_speed: 1.0
control: pid
pid_deriv_time: 2.0
pid_Kp: 2.0
pid_Ki: 5.0
pid_Kd: 0.5

#####################################################################
# Light
#####################################################################
## caselight LEDs
# [output_pin caselight]
# pin: PC7
# pwm: true
# cycle_time: 0.0100
# shutdown_value:0
# value:1

#####################################################################
# Buzzer
#####################################################################
## Buzzer
[output_pin buzzer]
pin: PA2
pwm: false
shutdown_value:0
value:0

[output_pin sound]
pin: PA13
value:0

#####################################################################
# Power outage shutdown
#####################################################################
[output_pin pwc]
pin: PA3
pwm: False
value: 1
shutdown_value: 1

#####################################################################
# Drives
#####################################################################
[danger_options]
homing_elapsed_distance_tolerance: 0.5

[stepper_x]
step_pin: PB4
dir_pin: PB3
enable_pin: !PB5
microsteps: 16
rotation_distance: 39.94
full_steps_per_rotation: 200
endstop_pin: tmc2209_stepper_x:virtual_endstop
position_min: -11
position_endstop: -11
position_max: 280
homing_speed: 40
homing_retract_dist: 0
homing_positive_dir: False
step_pulse_duration: 0.000002
use_sensorless_homing: True
homing_retract_dist: 5.0

[stepper_y]
step_pin: PC14
dir_pin: PC13
enable_pin: !PC15
microsteps: 16
rotation_distance: 39.96
full_steps_per_rotation: 200
endstop_pin: tmc2209_stepper_y:virtual_endstop
position_min: -24
position_endstop: -24
position_max: 280
homing_speed: 40
homing_retract_dist: 0
homing_positive_dir: False
step_pulse_duration: 0.000002
use_sensorless_homing: True
homing_retract_dist: 5.0

[stepper_z]
step_pin: PC10
dir_pin: PA15
enable_pin: !PC11
microsteps: 16
rotation_distance: 8
full_steps_per_rotation: 200
endstop_pin: probe:z_virtual_endstop
position_max: 280
position_min: -30
homing_speed: 25
#homing_speed: 10
homing_retract_dist: 0
second_homing_speed: 5
homing_positive_dir: false
step_pulse_duration: 0.000002

#####################################################################
# Steppers configuration
#####################################################################
[tmc2209 extruder]
uart_pin: Toolhead:gpio6
interpolate: true
run_current: 0.714              #!# Pay attention to this value and compare it with your stock backup config
stealthchop_threshold: 0
sense_resistor: 0.110

[tmc2209 stepper_x]
uart_pin: PD2
run_current: 1.07                #!# Pay attention to this value and compare it with your stock backup config
interpolate: true
stealthchop_threshold: 0
diag_pin: ^PB8
driver_SGTHRS: 85
sense_resistor: 0.110
home_current: 0.64
current_change_dwell_time: 1

[tmc2209 stepper_y]
uart_pin: PB9
run_current: 1.07               #!# Pay attention to this value and compare it with your stock backup config
interpolate: true
stealthchop_threshold: 0
diag_pin: ^PC0
driver_SGTHRS: 85
sense_resistor: 0.110
home_current: 0.73
current_change_dwell_time: 1

[tmc2209 stepper_z]
uart_pin: PC5
run_current: 0.285              #!# Pay attention to this value and compare it with your stock backup config
interpolate: true
stealthchop_threshold: 0
#stealthchop_threshold: 1200
sense_resistor: 0.110

#####################################################################
# Autotune TMC configuration
#####################################################################
[autotune_tmc stepper_x]
motor: qidi_x_y
tuning_goal: auto
sg4_thrs: 85

[autotune_tmc stepper_y]
motor: qidi_x_y
tuning_goal: auto
sg4_thrs: 97

[autotune_tmc stepper_z]
motor: qidi_z
tuning_goal: auto

[autotune_tmc extruder]
motor: qidi_e
tuning_goal: auto

#####################################################################
# Screws tilt adjust
#####################################################################
[screws_tilt_adjust] 
horizontal_move_z: 5
screw_thread: CCW-M4
speed: 300

screw1: 48, 23
screw1_name: front left screw
screw2: 229, 23
screw2_name: front right screw
screw3: 229, 202
screw3_name: rear right screw
screw4: 48, 202
screw4_name: rear left screw

#####################################################################
# Auto power off configuration
#####################################################################
[include fluidd/auto_power_off.cfg]  # Include Fluidd panel

[auto_power_off]
idle_timeout: 1200
temp_threshold: 50
power_device: homeassistant_switch
auto_poweroff_enabled: false
language: en
moonraker_integration: true
diagnostic_mode: false

#####################################################################
# Klipper TMC autotune configuration
#####################################################################
[motor_constants qidi_x_y]
resistance: 1.40
inductance: 0.0026
holding_torque: 0.41
max_current: 1.50
steps_per_revolution: 200

[motor_constants qidi_z]
resistance: 30
inductance: 0.062
holding_torque: 0.45
max_current: 0.4
steps_per_revolution: 200

[motor_constants qidi_e]
resistance: 2
inductance: 0.0012
holding_torque: 0.09
max_current: 1.00
steps_per_revolution: 200

